const ip = "localhost";
const tomcatPort = "8080";
const reactPort = "3000";

/**
 * @author Sven
 * @version 09/08/2021
 * OperatingModes
 * @type {{CARCONNECTED: number, WAITING: number, ERROR: number, NOCARCONNECTED: number, FINISHED: number, CHARGING: number}}
 */
const STATES = {
    ERROR: -2,
    OFFLINE: -1,
    WAITING: 0,
    NOCARCONNECTED: 1,
    CARCONNECTED: 2,
    CHARGING: 3,
    FINISHED: 4
}

const animStates = {
    OFFLINE: "errorAnim",
    NEUTRAL: "neutralAnim",
    WAITING: "waitingAnim",
    READY: "readyAnim",
    CHARGING: "chargingAnim",
    ERROR: "errorAnim",
}

const getAnimState = (stateId) => {
    switch (stateId) {
        case -1:
            return animStates.ERROR;
        case -2:
            return animStates.ERROR;
        case 0:
            return animStates.WAITING;
        case 1:
            return animStates.NEUTRAL;
        case 2:
            return animStates.READY;
        case 3:
            return animStates.CHARGING;
        case 4:
            // Make animation status charging even though it is fully charged
            return animStates.CHARGING;
        default:
            throw new Error(stateId + " is not a valid stateId");
    }
}

export {ip, tomcatPort, reactPort, getAnimState, STATES }
